.confirmation-dialog {
    padding: 20px;
    background: white;
    border-radius: 8px;
    
    .modal-header {
      border-bottom: 1px solid #dee2e6;
      padding-bottom: 15px;
      margin-bottom: 15px;
      
      .modal-title {
        color: #E27D60;
        font-weight: 600;
      }
    }
    
    .modal-body {
      padding: 15px 0;
      margin-bottom: 20px;
    }
    
    .modal-footer {
      display: flex;
      justify-content: flex-end;
      gap: 10px;
      
      .btn {
        padding: 8px 20px;
        border-radius: 20px;
        font-weight: 500;
        
        &.btn-secondary {
          background-color: #f1f1f1;
          color: #333;
          border: none;
        }
        
        &.btn-danger {
          background-color: #F44336;
          color: white;
          border: none;
        }
      }
    }
  }
